import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Login from './login/Login';
import SignUp from './login/SignUp';




function App() {
  return (
    <div>
        <a>AAAAAA</a>
        <BrowserRouter>

                <Routes>
                    <Route path={'/login'} element={<Login/>}></Route>
                    <Route path={'/signup'} element={<SignUp/>}></Route>
                </Routes>
        </BrowserRouter>

     </div>
  );
}

export default App;
